import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';

import { LoadAllAdminData } from './LoadAllDataAdmin';


import React, { Component } from 'react';

class AdminPage extends Component {
    constructor() {
        super()
        this.state = {
            user: {},
            message: "Error"
        }
    }

    async componentWillMount() {
        console.log(sessionStorage.getItem("user"))
        const id = sessionStorage.getItem("user");
        const response = await axios.get("http://localhost:8080/admin/find/" + id)

        this.setState({
            user: response.data
        })
       
        console.log(this.state.user)
    }

    
    render() {
        return (
            <div className="">
                <LoadAllAdminData />
                <Header
                    type="ADMIN" />
                {/* <UserHomeLayout 
                    type="ADMIN" /> */}
            </div>
        );
    }
}

export default AdminPage;
